(6, 'How To Mature A Fruitcake Quickly', 'Like a fine wine, fruitcakes get better with age. Learn from the experts at Collin Street Bakery how to mature your fruitcake quickly using this simple trick.', 'thumb-JSGsA.jpg', '<p>We know you don&rsquo;t really need a reason to order fruitcake from the Collin Street Bakery. Our cakes are so dang tasty, they&rsquo;re practically perfect for any occasion. But, if you&rsquo;re looking for an excuse, we&rsquo;re happy to help. How about because it&rsquo;s a day ending in &lsquo;Y&rsquo; --Satisfied? Phew, glad we got that out of the way. So, like we said, our cakes are super tasty as is. In fact, most of our customers have a hard time NOT tearing into their cake the second it arrives. BUT, if you want to have a fruitcake eating experience that&rsquo;s unlike any other, you may want to approach your fruitcake with a bit of patience.</p>\n\n<p>Yes, we said patience. Just like a fine wine, the flavors of your Collin Street fruitcake only get better with time. Luckily for you, unlike wine, maturing your fruitcake doesn&rsquo;t have to take decades or even years. It can actually be a relatively quick process if you know what to do. That&rsquo;s why the fruitcake experts here at Collin Street Bakery are here to show you how to mature a fruitcake quickly.</p>\n\n<p>&nbsp;</p>\n\n<h2><strong>How to Mature a Fruitcake Quickly</strong></h2>\n\n<p>Learning how to age a fruitcake quickly can turn you into a superstar guest at any holiday party. But before you RSVP to bring dessert, you must plan ahead. Like we said, aging a fruitcake will take a little time. The most common duration to properly age a fruitcake is about three months. Any quicker will limit the development of complex flavors attributed to the maturing process. You can certainly age your cake for much longer than several months if you&rsquo;d like, but we know how busy everyday life can be. So, we&rsquo;re here to show you how to mature a fruitcake quickly.</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>Step 1: Soaking</strong></h3>\n\n<p>In terms of flavor development, the first step in how to age a fruitcake quickly is arguably the most important. The soaking step is where you will soak (go figure) your fruitcake in your favorite boozy substance. Options to consider include bourbon, rum, or cognac. However, we&rsquo;ve also heard of our customers using port, vodka, scotch, and even wine with success! The simplest way of soaking the entire cake is to use a skewer or fork to poke holes across the cake&rsquo;s surface before carefully pouring onto it your spirit of choice. If you know yourself to be a heavy-handed pourer, then try this. Pre-measure your desired amount of liquor into a bowl and then taking a clean basting brush, evenly brush your cake till all the liquor has been used. This second approach will take a little longer, but is more exact.</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>Step 2: Wrapping</strong></h3>\n\n<p>After you soak your fruitcake, the next step of how to mature a fruitcake quickly is the wrapping process. The wrapping process is critical for aging as it encourages the liquor to stay inside the cake while limiting it&rsquo;s exposure to the air. The first wrapping layer should be cheesecloth, followed by a layer of plastic wrap, and finished with a layer of foil. At this point, your cake is fully covered, but we also recommend returning the cake to an airtight container for an extra layer of protection.</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>Step 3: Time and Temperature</strong></h3>\n\n<p>Timing and temperature are crucial steps in how to age a fruitcake quickly. After your cake has been soaked and wrapped, let it sit undisturbed at room temperature for at least one week. On it&rsquo;s one week soaking-anniversary, go ahead and carefully unwrap your cake, and repeat steps one and two. Go ahead and set a reminder because this will be the weekly routine for the entire duration of the maturing process. This soaking and sitting process allows the flavors to build, creating complexity and depth inside your cake. In terms of temperature, maturing a fruitcake is best done at room temperature out of direct sunlight. If your cake gets too warm, it has a high likelihood of spoiling. The same can occur if you place your fruitcake in the refrigerator. The notion being, we don&rsquo;t want the alcohol in the cake to turn and we don&rsquo;t want the cake to remain too wet. It&rsquo;s this delicate dance that when done well, turns your fruitcake into a flavorful feast.</p>\n\n<p>&nbsp;</p>\n', '2022-04-22 16:43:32', 'admin', 'how-to-mature-a-fruitcake-quickly', 15),
(7, 'Overnight Apple French Toast Bake', 'Overnight Apple French Toast Bake is made with sweetened apples, brioche bread, and an egg mixture flavored with maple syrup, topped with pecans, and drizzled with a cream cheese glaze. If you are just looking for French toast, this French Toast recipe is the...', 'post-QPnmJ.jpg', '<h2>Overnight Apple French Toast Bake</h2>  <p>This apple french toast bake is a perfect recipe to share with guests. It is a cross between an&nbsp;<a href=\"https://iambaker.net/breakfast-strata-broccoli-mushroom-and-cheese-eggbake/\">egg bake</a>,&nbsp;<a href=\"https://iambaker.net/apple-pie-filling/\">apple pie filling</a>, French toast, and&nbsp;<a href=\"https://iambaker.net/bread-pudding/\">bread pudding</a>. The egg mixture is flavored with maple syrup that complements the filling. Pecans can be added to the dish for crunch and more flavor. And finally, a cream cheese glaze is literally the icing on the bake.</p>  <h2>French Toast Bake Ingredients</h2>  <p>There are four parts to this recipe&ndash;the French toast filling, the egg mixture, chopped pecans, and cream cheese glaze.</p>  <p><strong>Apples:&nbsp;</strong>I recommend granny smith apples in this recipe. They hold up well when baked. A few other options you could try would be Honeycrisp apples, Braeburn, or Pink Lady apples.</p>  <p><strong>Bread:&nbsp;</strong>I chose to use brioche, a French bread, in this recipe. It is somewhat of a pastry and bread combo that tasted amazing in this recipe! You could also use another sweet bread like Hawaiian bread or even&nbsp;<a href=\"https://iambaker.net/french-baguettes/\">French bread</a>.</p>  <p><strong>Pecans:&nbsp;</strong>If you do not want to add nuts, simply leave them out of the recipe.&nbsp;</p>  <p><strong>Glaze:&nbsp;</strong>When making the glaze, make sure the butter, cream cheese, and milk are all at room temperature. Cold ingredients will cause the glaze to clump and separate and not be as smooth.</p>  <p><img alt=\"Pouring Liquid over Bread for Overnight Apple French Toast Bake\" src=\"https://iambaker.net/wp-content/uploads/2021/11/cinn-apple-french-toast-bake-process.jpg\" style=\"height:740px; width:650px\" /></p>  <h2>Apple French Toast Filling</h2>  <p>The first thing to do in this recipe is to get the apple french toast filling made. To do this, peel, core, and dice the apples. After the apples are cubed, melt the butter in a medium saucepan. Add the apples to the melted butter to let them cook for about 5 minutes, or until they are softened.</p>  <p>Next, add the brown sugar and cinnamon. Cook until the sugar has dissolved, and then set this aside to cool. As the apple mixture is cooling, cube the bread and add half of it to a greased 9&times;13-inch baking dish. Pour half of the apple mixture on top of the bread. Repeat the layers with the other halves of the bread and apple mixture. Set this aside as you prepare the egg mixture.</p>  <p><img alt=\"Pouring Glaze over Overnight Apple French Toast Bake\" src=\"https://iambaker.net/wp-content/uploads/2021/11/cinn-apple-french-toast-bake-process-1.jpg\" style=\"height:770px; width:650px\" /></p>  <h2>How to Make Overnight Apple French Toast Bake</h2>  <p>With the word overnight in the title, I am sure you know that for best results, this apple french toast bake should be refrigerated overnight. Before refrigerating the egg bake, make the egg mixture to add the layers of bread and apples. Simply combine the ingredients of the egg mixture and pour it over the bread and apples. Cover the dish with plastic wrap and refrigerate it overnight.</p>  <p>When ready to bake (meaning the next day), remove the french toast bake from the refrigerator and preheat the oven. Let the egg bake sit at room temperature for about 30 minutes before putting it into the oven. Top the french toast bake with pecans, if adding. Then, cover the dish with aluminum foil. Bake for 40 minutes. Then, remove the foil and bake for an additional 40 minutes. The apple french toast bake is done when the center is no longer jiggly.</p>  <h2>How to Make the Glaze</h2>  <p>The glaze is a cream cheese glaze that puts the sweetening touch on the overnight apple french toast bake. To make the glaze, be sure to use room-temperature ingredients. In a bowl, mix together the ingredients for the glaze. Start with a tablespoon of milk and add more as needed until the glaze reaches your desired consistency. Pour the glaze over the warm french toast bake and serve.</p>  <p><img alt=\"Overhead of Overnight Apple French Toast Bake in a White Casserole Pan\" src=\"https://iambaker.net/wp-content/uploads/2021/11/cinn-apple-french-toast-bake-1.2.jpg\" style=\"height:609px; width:800px\" /></p>  <h2>Do I Have to Refrigerate this Overnight?</h2>  <p>For the best results, I recommend letting the apple french toast bake chill in the refrigerator overnight. This gives the egg mixture plenty of time to soak into the bread. However, you could get away with baking this after the dish has been in the refrigerator for as few as 2-3 hours.</p>  <p>&nbsp;</p>', '2022-04-22 16:42:44', 'admin', 'overnight-apple-french-toast-bake', 12),
(8, 'How Long Is Fruitcake Good For?', 'Make this years holiday gift-giving experience absolutely unforgettable with our holiday shopping guide filled with treats guaranteed to please. Whether you are looking for Mom, Dad, Grandma, or the kids, we promise our guide is packed with presents perfect for the whole family!', 'post-21CjY.jpg', ' <p>We can confidently say fruitcake is a dessert-like no other. With an unbelievably unique combination of tastes and textures, a slice of Collin Street&rsquo;s signature DeLuxe&reg;&nbsp;<a href=\"https://collinstreet.com/buy-fruitcake-online\"><strong>Fruitcake</strong></a>&nbsp;takes you down a one-way street to flavor town --a town where the party doesn&rsquo;t end till all the cake is eaten.&nbsp;</p>  <p>But, sometimes, it can take a while to eat all that cake. So, what do you do with it once you&rsquo;ve had your fill?&nbsp;How long is fruitcake actually good for? How do you properly store it?&nbsp;&nbsp;Can you freeze fruitcake? What if I made my fruitcake boozy? Does that change anything?&nbsp;</p>  <p>These are all&nbsp;<em>really</em>&nbsp;good questions and, luckily for you, we have the answers.<br /> &nbsp;</p>  <h2><strong>How Long Is Fruitcake Good For</strong><strong>?</strong></h2>  <p>Fruitcake is no ordinary cake. It can stay fresh and edible for months after baking. What typically makes fruitcake last so long is that it&#39;s&nbsp;<strong><em>super</em></strong>&nbsp;dense texture. This texture prevents, let&rsquo;s say, less than appetizing things from setting up camp in the cake&rsquo;s crevices. Additionally, a lot of the ingredients in our fruitcakes are dried or glace&eacute;d, so they don&rsquo;t contain much moisture. And moisture is the villain in all food preservation efforts.<br /> &nbsp;</p>  <h2><strong>How Long Will Fruitcake Last With Alcohol</strong><strong>?</strong></h2>  <p>So,&nbsp;how long&nbsp;exactly&nbsp;will fruitcake last with alcohol? Again, fruitcake covered or soaked in alcohol can last much longer than its sober counterparts.. Fruitcake with alcohol can last years, and in some rare cases, it can last decades. For those looking to prepare fruitcakes with alcohol for storage, you&rsquo;ll want to make sure to brush the fruitcake with alcohol fairly consistently across it&rsquo;s time in storage.<br /> &nbsp;</p>  <h2><strong>How to Store Fruitcake Without Alcohol?</strong></h2>  <p>Fruitcake without alcohol won&rsquo;t last as long, however, its shelf life can still be maximized through proper storage techniques. Our fruitcake can last up to one month on your countertop, four months in the fridge, and six months in the freezer. Of course, all this depends on the effectiveness of your storage. We recommend an airtight container of some kind.&nbsp; For storing fruitcake, you&rsquo;ll want to make sure to cover it with plastic wrap and place it in an airtight container.<br /> &nbsp;</p>  <h2><strong>Can You Freeze Fruitcake</strong><strong>?</strong></h2>  <p>Yes, you can freeze fruitcake. Freezing fruitcake allows it to retain its freshness and quality much longer. In a typical freezer, fruitcake can usually be stored for at least six months. Similar to regular storage, you&rsquo;ll want to wrap the fruitcake in plastic wrap, then wrap your cake in foil, and place your double-wrapped cake in an airtight container and in the freezer.</p>', '2021-12-10 17:56:46', 'admin', 'how-long-is-fruitcake-good-for', 7),
(9, 'Pumpkin Spice Bundt Cake With Creamy Pumpkin Glaze', 'Pumpkin Spice Bundt Cake with Creamy Pumpkin Glaze gives a bundt cake a Fall twist by adding pumpkin puree to both the cake and the pumpkin glaze. Try my Pumpkin Dessert for another dessert to add to your Thanksgiving menu. Pumpkin Spice Bundt Cake...', 'post-uVD3Y.jpg', '<h2>Pumpkin Spice Bundt Cake</h2>  <p>With pumpkin spice season upon us (I mean Fall), why not add a bundt cake with pure pumpkin in the recipe to the list? Pumpkin puree is added to both the cake and the glaze for just the right amount of pumpkin flavor in every bite. The cake is a moist cake that could be added to your holiday menu or enjoyed with a cup of coffee on a cool, crisp morning.</p>  <h2>Pumpkin Spice Bundt Cake with Creamy Pumpkin Glaze Ingredients</h2>  <p>There are two pumpkin-flavored parts to this recipe&ndash;the bundt cake and the glaze. The important ingredient in both is pumpkin puree.</p>  <p><strong>Pumpkin Puree:&nbsp;</strong>Be sure to look for pumpkin puree, not pumpkin pie filling. Pumpkin puree is cooked pumpkin that is blended or mashed into a smooth texture. There should be no seasoning, spice, flavoring, or sugar added. We are adding our own seasoning and sweetness into the cake and glaze so just want the pure pumpkin flavor of the puree.</p>  <p><img alt=\"Adding Glaze to Pumpkin Bundt\" src=\"https://iambaker.net/wp-content/uploads/2011/09/pumpkin-bundt-1.jpg\" style=\"height:915px; width:800px\" /></p>  <h2>How to Make the Bundt Cake</h2>  <p>To get started, make sure your ingredients are at room temperature. When ready, use a hand mixer or a stand mixer with a paddle attachment to mix the sugar and butter until smooth. Next, add the eggs, one at a time (mixing well after adding each egg).</p>  <p>Then, add the pumpkin puree, sour cream, and vanilla. Mix on low until combined. While the mixer is on low, add the flour, one cup at a time, followed by the cinnamon, baking soda, and salt. Mix until incorporated.</p>  <p>After the batter has been mixed, pour it into a greased bundt pan. Make sure the pan has about an inch and a half of room at the top after pouring. As far as baking temperature and time, that is something you will want to keep a close eye on. If you happen to have any hot spots in your oven you may want to turn the cake halfway through baking.</p>  <p>When the cake is done baking, remove it from the oven and let it cool in the pan for a while before flipping it onto a plate. (There may be cracks in the cake, but that is okay, and actually quite common with pound cakes.) It is important to give it time to rest in the pan. This resting time will help the sides of the cake release a bit before it is inverted. It is up to you if you choose to level the cake after flipping it.</p>  <p><img alt=\"Piece of Pumpkin Bundt on Plate\" src=\"https://iambaker.net/wp-content/uploads/2011/09/pumpkin-bundt-3.jpg\" style=\"height:578px; width:800px\" /></p>  <h2>How to Make the Glaze</h2>  <p>As the cake is cooling, make the creamy pumpkin glaze. To make the glaze, add the confectioners&rsquo; sugar to a bowl and slowly whisk in the milk. Start with a tablespoon of milk; then, add a teaspoon of milk at a time until the glaze reaches your desired consistency. Continue whisking while adding the vanilla, pumpkin puree, cinnamon, and melted (cooled) butter. Drizzle the glaze over the cooled cake. Cut and enjoy!</p>', '2022-03-27 20:52:54', 'admin', 'pumpkin-spice-bundt-cake-with-creamy-pumpkin-glaze', 3);

