INSERT INTO `product` (`product_id`, `product_name`, `product_price`, `product_discount`, `product_thumb`, `product_album`, `product_description`, `product_status`, `product_view`) VALUES
(22, 'Brownie', 5, 10, 'thumb-2Oh93.png', '[]', '<p>A delicious and decadent Brownie Cake made from scratch. This moist and tender cake is made using real chocolate and boasts a crackly, meringue-like crust.</p>\n\n<p>&nbsp;</p>\n\n<p>This chocolate cake is one of the best things to come out of the Sweetest Menu kitchen this year.</p>\n\n<p>Just like a regular brownie, it has a that soft centre that tastes oh-so-chocolately. Mine is also studded with chocolate chips and crunchy walnuts &ndash; optional of course, but totally worth it.</p>\n', b'1', 1),
(23, 'Red Velvet', 6, 0, 'thumb-Ixlin.png', '[]', '<p>Red velvet is such a unique cake because it has a vanilla flavor but also a hint of chocolate. It can also be hard to get just right because it should be buttery, yet stay moist.&nbsp;</p>\n\n<p>Is it chocolate? Is it vanilla? WHAT IS IT! Essentially it&rsquo;s a chocolate cake made with little cocoa powder. The cocoa reacts with the acidic vinegar and buttermilk, and in turn keeps the cake moist, light, and fluffy. The chocolate taste is fairly mild but the flavours are delicately rich.</p>\n', b'1', 4),
(24, 'Rye Bread', 4.99, 0, 'thumb-hCxLw.png', '[]', '<p>For as long as I knew my friend George he was an enthusiastic bread maker. Often when I visited his home in Carlisle, Massachusetts, he had a freshly baked loaf of rye bread for us to enjoy.</p>\n\n<p>&nbsp;</p>\n\n<p>One time when George came to visit my family in Carmichael, I put him to work, showing me the way he makes his rye bread.</p>\n\n<p>FEATURED VIDEO</p>\n\n<p>&nbsp;</p>\n\n<p>0 seconds of 4 minutes, 45 secondsVolume 0%</p>\n\n<p>04:45</p>\n\n<p>&nbsp;</p>\n\n<p>SKC - Homemade Pasta</p>\n\n<h2>What Is Rye Bread?</h2>\n\n<p>Rye bread is simply bread that is made with rye flour. Rye has an earthy flavor, and using more or less of it in combination with other flours a loaf will give it more or less of that flavor. Rye bread is often made with additions like molasses and cocoa powder, which add color and flavor. Caraway seeds can be added as well, for an even more distinctive flavor.</p>\n\n<p>&nbsp;</p>\n\n<p>While you can make a loaf that is made 100% rye, those tend to be quite dense and heavy. For a lighter loaf that still has good rye flavor, mix rye flour with bread flour, which helps form a better gluten structure within the dough.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>As for this particular bread from George?</strong>&nbsp;It was wonderful. Lightly flavored, soft inside, with a crusty crust. My father doesn&#39;t like caraway seeds so they were kept out. I love them so the next time I make this bread they&#39;re going in.</p>\n\n<p><img alt=\"George holding his rye bread\" src=\"https://www.simplyrecipes.com/thmb/mLX_D1Oa4V3Pvcw5rqhlvgkC7S0=/1400x933/filters:no_upscale():max_bytes(150000):strip_icc():format(webp)/__opt__aboutcom__coeus__resources__content_migration__simply_recipes__uploads__2007__01__george-holding-rye-bread-horiz-50b392a0301c44a3bff64498ca45021f.jpg\" style=\"height:933px; width:1400px\" /></p>\n\n<p>George holding his rye bread.&nbsp;Sally Vargas and Elise Bauer</p>\n\n<h2>Best Way to Learn to Bake Bread? Hands on!</h2>\n\n<p>I don&#39;t think one can easily learn to make bread by reading about it.</p>\n\n<p>It really helps to get your hands in it and learn directly from someone who can say, &quot;See? This is the right consistency for the dough.&quot; Bread making is something that you just have to practice. The more bread you make, the better you get at it.</p>\n', b'1', 1),
(25, 'Poppy Bagel', 4.99, 0, 'thumb-JaTR4.png', '[]', '<h1>Poppy Seeds</h1>\n\n<p>The poppy seed originates from the opium poppy plant. They are tiny, kidney shaped seeds that are harvested from dried poppy pods. This process has been done for thousands of years, and this little seed is widely used in many countries.</p>\n\n<p>&nbsp;</p>\n\n<h3>Nutrition behind the seed</h3>\n\n<p>Poppy seeds happen to be a rich source of the vitamine B members, particularly thiamine, folate and vitamin B6. And these powerful seeds contain several essential minerals as well! Feeling low on your calcium, iron, magnesium manganese, phosphorus or zinc? Grab yourself a delicious poppy seed snack to get your fix in!&nbsp;</p>\n\n<p>Fun fact: poppy seeds have been known to falsify drug tests. Although the opium drug is produced from a different part of the opium poppy plant, all parts of this amazing creation contain or carry the opium alkaloids (particularly morphine and codeine).&nbsp;</p>\n', b'1', 0),
(26, 'Cream Muffin', 7, 10, 'thumb-h54yU.png', '[]', '<p>These Cream Muffins will be the softest muffins you have ever had in your entire life. Using vegetable oil as the fat element, these muffins are made with no butter. Incredibly moist, without increased density, these cookies are made with heavy cream for a light texture. These Cream Muffins have a hidden surprise inside, a thin layer of hazelnut cream! Enjoy these creamy, soft muffins as a grab and go breakfast or an afternoon snack.</p>\n', b'1', 0),
(27, 'Macaron Cake', 10, 20, 'thumb-IZc3j.png', '[]', '<p>The macaron disks that are crispy on the outside while the interior gets soft and a bit chewy, are making&nbsp; a good balance with the tart raspberry jam and sweetened buttercream. You can always consider making a ganache for the filling or choose your favorite frosting and the results will always be satisfying, no doubt about that.</p>\n\n<p>Macaron Cake is very different from a regular cake and it can be adapted to different flavors and fillings. It is best to be prepared a day in advance as it needs time to soften the macaron disks before serving. Hope you will try it out, and enjoy!</p>\n', b'1', 0),
(28, 'Baguette bread', 8, 10, 'thumb-R8rGj.png', '[]', '<p>These crunchy baguettes feature a chewy interior riddled with holes, and a crisp, deep-golden crust. While it&#39;s a challenge to make &quot;real&quot; baguettes at home, this version is probably as close to an artisan bakery version as you&#39;re going to find. The ingredients in baguettes are pure simplicity: flour, water, salt, and yeast. It&#39;s the baker&#39;s technique that turns an average baguette into an all-star. Don&#39;t expect perfection the first time out, but the more you practice your baguette-baking techniques, the better the baguette you&#39;ll make.</p>\n', b'1', 2),
(29, 'French Bun', 5, 10, 'thumb-SnkvU.png', '[]', '<p>Aliquam pulvinar vestibulum blandit. Donec sed nisl libero. Fusce dignissim luctus sem eu dapibus. Pellentesque vulputate quam a quam volutpat, sed ullamcorper erat commodo. Vestibulum sit amet ipsum vitae mauris mattis vulputate lacinia nec neque. Aenean quis consectetur nisi, ac interdum elit</p>\n', b'1', 0),
(30, 'Italian Loaf', 4.99, 0, 'thumb-SYtoH.jpg', '[]', '<h2><strong><em>How to Make Italian Bread from Scratch</em></strong></h2>\n\n<p>Sometimes I wish I had one of those potions from Alice in Wonderland so I can make myself small enough to lay on a slice of this Italian bread like a pillow. A heavenly soft, carbolicious pillow.</p>\n\n<p>But seriously, how wonderful would that be? Because not only are you totally comfy-cozy, you also have a snack right there to munch on as needed. And then when you want to eat the bread as a sandwich or make it into a yummy baked French toast or strata or something, you can take the potion that makes you big again. It&rsquo;s perfect.</p>\n\n<p>Aaaaaand I&rsquo;ve lost you. But homemade, soft-on-the-inside-crusty-on-the-outside classic Italian bread, remember? Yes, let&rsquo;s focus more on that.</p>\n', b'1', 0),
(31, 'White Chocolate Rasberry', 10, 20, 'thumb-JnBcw.jpg', '[]', '<p>This recipe started as a full cheesecake that went horribly wrong. I&rsquo;m chalking it up to poor decisions in the recipe creation process, but it (1) was too thick (2) overflowed and (3) burned around the edges (from the sugar in the white chocolate I believe?). It tasted fine, but I knew I could do better especially since this classic&nbsp;<a href=\"https://sallysbakingaddiction.com/classic-cheesecake/\">cheesecake recipe</a>&nbsp;is top-notch.</p>\n\n<p>I didn&rsquo;t really have an occasion for a full cheesecake coming up, nor did I want to waste another 2 lbs of cream cheese and raspberries, so I tossed the whole idea and opted for white chocolate raspberry cheesecake bars instead. I always appreciate cheesecake I can eat with my hands, plus these are easier to serve to a crowd.</p>\n\n<h2>Why You&rsquo;ll Love These White Chocolate Raspberry Cheesecake Bars:</h2>\n\n<ul>\n	<li>Easier than a full cheesecake</li>\n	<li>No messing with a water bath</li>\n	<li>Quicker to bake &amp; chill than a full cheesecake</li>\n	<li>Portable</li>\n	<li>Hand-held individual servings</li>\n	<li>Exceptionally creamy</li>\n	<li>Made with real white chocolate &amp; raspberries</li>\n	<li>Buttery Oreo cookie crust</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"white chocolate raspberry cheesecake bars\" src=\"https://cdn.sallysbakingaddiction.com/wp-content/uploads/2020/02/white-chocolate-raspberry-cheesecake-bars-3.jpg\" style=\"height:900px; width:600px\" /></p>\n', b'1', 0),
(32, 'Caramel Apple', 9.99, 0, 'thumb-A1MjW.jpg', '[]', '<p>Fall is in full swing and what better way to celebrate than with a traditional county fair inspired treat?! I originally published homemade caramel apples in my cookbook&nbsp;<a href=\"https://amzn.to/2mSYiWj\" target=\"_blank\">Sally&rsquo;s Candy Addiction</a>. There you&rsquo;ll also find candy how-to&rsquo;s and recipes including toffee, candy apples, caramels, fudge, truffles, chocolate bark, taffy, and marshmallows. I decided to slightly adapt my original recipe, adding a little more butter and corn syrup for a softer, silkier caramel coating.</p>\n\n<h2>Real Homemade Caramel Apples</h2>\n\n<p>We&rsquo;re making homemade caramel apples with caramel cooked completely from scratch on the stove. No store-bought caramel candies or coatings because you can truly taste the difference between that and homemade. If cooked a little longer, this real caramel can be made into soft caramel candies like my&nbsp;<a href=\"https://sallysbakingaddiction.com/sea-salt-vanilla-caramels/\">sea salt vanilla caramels</a>. Today I&rsquo;m sharing the recipe, all my recommended tools, tips for success, and showing you a video tutorial so you can see&nbsp;<strong>just how easy</strong>&nbsp;it is to make&nbsp;<strong>real caramel</strong>&nbsp;for&nbsp;<strong>homemade caramel apples</strong>.</p>\n\n<p><img alt=\"caramel apples on a baking sheet\" src=\"https://cdn.sallysbakingaddiction.com/wp-content/uploads/2019/09/caramel-apples.jpg\" style=\"height:900px; width:600px\" /></p>\n', b'1', 0),
(33, 'Chocolate Muffin', 6, 20, 'thumb-4N19p.jpeg', '[]', '<p><em>These double chocolate muffins have been our&nbsp;<strong>favorite chocolate muffin recipe</strong>&nbsp;for over a decade. I love them so much that I published the easy recipe in my&nbsp;<a href=\"https://sallysbakingaddiction.com/sallys-cookbooks/sallys-baking-addiction-cookbook/\">1st cookbook</a>&nbsp;back in 2014! (We now add even more chocolate chips and a touch of vanilla for extra flavor, as you&rsquo;ll see in the recipe below.) The muffins are incredibly rich, mega chocolate-y, and loaded with chocolate chips in every single bite. Sour cream helps guarantee a soft and moist muffin that has a denser texture than chocolate cupcakes.</em></p>\n\n<p>&nbsp;</p>\n\n<p>Not pointing fingers or anything but&nbsp;<a href=\"https://sallysbakingaddiction.com/chocolate-sweet-rolls/\">chocolate sweet rolls</a>, you&rsquo;re kind of high maintenance for the morning. (Worth the hype and effort for sure though.) Here&rsquo;s something easier that satisfies your chocolate craving and doesn&rsquo;t require a ton of effort, time, or patience. Ha!</p>\n\n<h2>Double Chocolate Muffins Details</h2>\n\n<ul>\n	<li><strong>Flavor:&nbsp;</strong>Chocolate. Seriously, that&rsquo;s all you really need to know! This chocolate muffin recipe comes together with cocoa powder and chocolate chips. In recent years, I began adding vanilla extract to the batter for a touch of extra flavor. You can certainly leave it out if you&rsquo;d like (and as mentioned above, the cookbook recipe doesn&rsquo;t include it).</li>\n	<li><strong>Texture:&nbsp;</strong>Unlike&nbsp;<a href=\"https://sallysbakingaddiction.com/super-moist-chocolate-cupcakes/\">chocolate cupcakes</a>&nbsp;and&nbsp;<a href=\"https://sallysbakingaddiction.com/triple-chocolate-layer-cake/\">chocolate cake</a>, these muffins don&rsquo;t really have a sponge-like texture. And that&rsquo;s mostly because we&nbsp;<strong>aren&rsquo;t adding hot water to the batter</strong>. They&rsquo;re more like a bakery-style muffin with a tighter crumb and satisfying bite.</li>\n	<li><strong>Ease:&nbsp;</strong>Besides the deep chocolate flavor, what you&rsquo;ll love most about this double chocolate chip muffin recipe is its ease. The recipe uses common baking ingredients, doesn&rsquo;t require a mixer, and is super straightforward&ndash; 2 cups of this, 1 cup of that, and whole eggs. (No separating needed.)</li>\n</ul>\n', b'1', 0),
(34, 'No-bake chocolate', 4, 0, 'thumb-mYJT9.png', '[]', '<p>This No Bake Chocolate Cake is also known as a Chocolate Biscuit Cake, a Refrigerator Cake, and a Chocolate Tiffin (&#39;Tiffin&#39; being an Anglo-Indian term for lunch or afternoon snack). It is a popular English cake that reminds me of a chocolate bar. I love how it looks with all the pretty flecks of nuts and biscuits encased in dark chocolate. It is so easy to make. Just melt some really good chocolate with butter and golden syrup (or corn syrup, honey, agave or brown rice syrup) and then fold in lots of chopped nuts and crushed Digestive Biscuits (or Graham Crackers). That&#39;s it. Pour into a pan and let it chill, preferably for a day or two, before indulging. The chilling not only makes the cake nice and firm but it gives the flavors time to soften and mingle into one delicious cake that you won&#39;t be able to stop eating.<br />\n&nbsp;</p>\n\n<p>Whenever you are making a dessert where chocolate is the dominant flavor, it is important to use a good quality semisweet or bittersweet chocolate that you enjoy eating out of hand. Some choices you may want to try are Guittard, Lindt, Newman&#39;s Own, Scharffen Berger, Valrhona, and Ghirardelli, to name a few. Besides the chocolate there are also choices of what type of nuts to add to this cake. Almonds, hazelnuts, macadamia, peanuts, pecans and/or walnuts are excellent choices and you can use just one nut or have a variety. The one ingredient that some people may not be unfamiliar with is Digestive Biscuits (McVitie&#39;s Digestive is the most common brand found in North America). This is a British cookie that has a slightly sweet flavor and a wonderfully crisp and sandy texture. You can find them in some grocery stores, specialty food stores, and on line. However, Graham Crackers are a very good substitute as are shortbread cookies, butter cookies, or even ginger cookies. For a little trivia - Alan Davidson tells us in &#39;The Oxford Companion to Food&#39;&nbsp; that the word &#39;Digestive&#39; cannot be used in the States so other names like &#39;sweetmeal&#39; or &#39;wholemeal&#39; are often used for this type of cookie.</p>\n', b'1', 0),
(35, 'German Chocolate Cake', 9.99, 30, 'thumb-NUbVE.jpg', '[]', '<h2>What is German Chocolate Cake?</h2>\n\n<p>The name German chocolate cake is a little deceiving as it is not actually a German dessert and traditionally the cake is a lighter colored cake with a mild chocolate taste and the entire cake is usually covered in coconut pecan frosting.&nbsp; My family&rsquo;s version is a chocolate cake with chocolate frosting covering the cake and coconut frosting on top and in the center of the cake. This cake seriously can&rsquo;t be beat, especially if you&rsquo;re a chocolate lover!</p>\n\n<h2>How to Make German Chocolate Cake:</h2>\n\n<p><strong>1. Make the chocolate cake:</strong>&nbsp;Combine dry ingredients (sugar, flour, cocoa, baking powder, baking soda and salt). Combine wet ingredients (eggs, buttermilk, oil and vanilla). Mix together and stir in boiling water.</p>\n\n<p><strong>2. Bake at 375&deg;F:</strong>&nbsp;Pour batter into prepared 8 or 9-inch round baking pans. I like to cut a round piece of wax or parchment paper for the bottom of the pan also, to make sure the cake comes out easily.</p>\n\n<p>Homemade German Chocolate Cake with layers of coconut pecan frosting and chocolate frosting. This cake is incredible!</p>\n\n<p><strong>3. Make the German Chocolate Frosting:</strong>&nbsp;Combine brown sugar, granulated sugar, butter, egg yolks, and evaporated milk in a saucepan and bring the mixture to a low boil over medium heat. Stir constantly until the mixture thickens.&nbsp; Remove from heat and stir in vanilla, nuts and coconut. Allow to cool completely before layering it on the cake.</p>\n\n<p><img alt=\"Four process photos for making German Chocolate Frosting, in a saucepan.\" src=\"https://tastesbetterfromscratch.com/wp-content/uploads/2017/05/German-Chocolate-Cake-9-922x1024.jpg\" style=\"height:1024px; width:922px\" /></p>\n\n<p><strong>4. Make chocolate frosting</strong>:&nbsp;&nbsp;Melt butter, stir in cocoa powder, slowly add powdered sugar and milk, beating to spreading consistency. Add small amount additional milk, if needed to thin the frosting, or a little extra powder, until you reach your desired consistency. Stir in vanilla.</p>\n\n<p><strong>5. Assemble:</strong>&nbsp;Place one of the cake rounds on your serving stand or plate.&nbsp; Smooth a thin layer of chocolate frosting over the cake layer, and then spoon half of the coconut frosting on top, spreading it into a smooth layer. Leave about &frac12; inch between the filling and edge of cake.&nbsp; Stack the second cake round on top. Smooth chocolate frosting over the entire cake.&nbsp;&nbsp;Spoon remaining coconut frosting on top of the cake.</p>\n', b'1', 0),
(36, 'Chocolate Bake', 7, 20, 'thumb-QW7Ez.png', '[]', '<p>For as long as I can remember, chocolate has been one of my chief extracurricular activities. From brownies to birthday cake to mousse, I&#39;ve formed an emotional bond with the stuff. I love it all: from a mild and milky Hershey&#39;s Kiss to the fruity astringency of a dark chocolate bar. Who wouldn&#39;t become hooked on something that adds such depth of flavor, rich texture, and inexplicable allure?</p>\n\n<p>&nbsp;</p>\n\n<p>Inseparable from its history, chocolate retains the folklore and romance surrounded by the ancient cultures of the Mayans and Aztecs and the kings, queens, and pirates of the Spanish court. Originally consumed by the Aztecs as a frothy, bitter drink, chocolate was believed to have divine properties and was considered so valuable that it was used as currency. Even the Latin name for the cacao tree, Theobroma cacao, means &quot;food of the gods.&quot;</p>\n\n<p>FEATURED VIDEO</p>\n\n<p>&nbsp;</p>\n\n<p>0 seconds of 1 secondVolume 0%</p>\n\n<p>05:20</p>\n\n<p>&nbsp;</p>\n\n<p>How to Make No-Bake Cookies</p>\n\n<p>As chocolate traveled with the Spanish explorers, sugar cane and honey were added to suit European tastes, and it quickly became an elite and fashionable drink throughout Spain. It was not until the rise of industrialization, and the help of chocolate giants like Rodolphe Lindt, Henri Nestle, and Milton Hershey, that chocolate became widely available. From &quot;food of the gods&quot; to &quot;gimme a break,&quot; chocolate spans centuries of cultures and tastes and still remains a coveted treat and ingredient. Despite its long history, many transformations and seemingly limitless varieties, you don&#39;t have to be Aztec god, nor Oompa Loompa, to understand and appreciate chocolate.</p>\n\n<p>For bakers, chocolate is one hell of a complicated ingredient&mdash;over 600 volatile compounds contribute to its aroma and flavor. So if you want to bake with chocolate, it helps to know some fundamentals. Chocolate&#39;s taste and texture are products of the variety of cacao tree, where it&#39;s grown, and how it&#39;s fermented, dried, roasted, and tempered. Here&#39;s what you need to know.</p>\n\n<p>&nbsp;</p>\n', b'1', 2),
(37, 'Wheat Loaf', 4.99, 0, 'thumb-MB8Ql.jpg', '[]', '<p>I embarked upon this ingredient one day when I was making naan. Typically the Indian&nbsp;<strong><a href=\"https://www.vegrecipesofindia.com/naan-recipe-without-yeast/\">Naan</a></strong>&nbsp;and&nbsp;<strong><a href=\"https://www.vegrecipesofindia.com/bhatura-recipe-bhature-bhatura/\">Bhatura</a></strong>&nbsp;have one ingredient that helps in the leavening process and gives a soft texture, even when the naans are made without yeast. I thought why not try using this ingredient in a bread. And it worked like a charm.</p>\n\n<p>Later while studying more about bread baking, I came to know that an acidic medium in limits, helps in gluten development. So no wonder that this ingredient worked. So before you ask me what is the secret&hellip; Let me tell you &ndash; its&nbsp;<strong>Curd or yogurt</strong>.</p>\n\n<p>Well the bread has a slight taste of yogurt, but really it does not matter. Later I experimented with another two acidic ingredients &ndash;&nbsp;<strong>Vinegar and lemon juice</strong>&nbsp;and these too worked very well. With vinegar the bread had a slight taste of vinegar, but we had no issues.</p>\n\n<p>As a vegetarian, you can use dairy yogurt and as a vegan you can use cashew yogurt or vinegar or lemon juice.</p>\n\n<p><strong>To make this wholemeal bread, I have used instant yeast.</strong>&nbsp;I have mentioned the proportions of&nbsp;<strong>Dry active yeast</strong>, as well in the recipe details and the method too. I brought the instant yeast from amazon.in and the brand is gloripan instant dry yeast</p>\n', b'1', 0),
(38, 'Poppy Roll', 4.99, 0, 'thumb-uX3PN.jpg', '[]', '<p>Poppy Seed Rolls in a flash? That&rsquo;s right. Without having to wait for the rising time, you can have bakery fresh pastries on the table in under an hour!&nbsp;&nbsp;</p>\n\n<p>Poppy Seed Rolls are stuffed with a sweet and crunchy filling that is seriously to-die-for. While poppy seeds are no stranger to American baking, they are IMMENSELY popular in Polish and Ukrainian baking.&nbsp;</p>\n\n<p>Some of the best memories I have as a child include gobbling up these delicious rolls. Now that I am an adult, I like to pair them with a nice cup of coffee or mug of tea. I&rsquo;m looking forward to hearing your thoughts and feedback in the comments below!&nbsp;</p>\n', b'1', 1),
(39, 'Signature Cake', 5, 0, 'thumb-w2Mdj.png', '[]', '<p>Who can resist the joy of biting into this rich delicacy? The combination of Belgium dark chocolate and hazelnut is a marriage made in heaven. This sinful Belgium dark chocolate cake is eye-pleasing and soul-satisfying. At the heart is a rich cream filling made with Belgium dark chocolate, sandwiched between moist, eggless sponges. Final touches include an immaculately placed, crunchy sable biscuit with swirls of the rich cream filling, crunchy hazelnuts, tempered chocolate curls and feuilletine. Irresistible!</p>\n\n<p><strong>&nbsp;</strong></p>\n\n<p>Let&rsquo;s face it, SMOOR&rsquo;s eggless Belgium Dark Chocolate and Hazelnut Truffle cake is grand and that&rsquo;s why we love baking it for you. We use the finest couverture Belgium dark chocolate in our signature chocolate cake recipes which makes every mouthful extra satisfying.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Elegance never tasted so good!</strong></p>\n\n<p>An ideal gift to celebrate an intimate occasion, or for the times you wish to tell someone that they are loved, this eggless Belgium Dark chocolate And Hazelnut Truffle cake does beautifully. Great with a cup of cappuccino, and perfect for midnight cravings.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>INGREDIENTS</strong><br />\nEggless Chocolate Sponge, Chocolate Hazelnut Filling (Chocolate Ganache, Whip Cream, Hazelnut ), Hazelnut Crunch, Chocolate Glaze, Sable Biscuit,</p>\n\n<p>&nbsp;&nbsp;&nbsp;</p>\n\n<p><strong>ALLERGEN ADVICE</strong><br />\nContains Milk Solids, Gluten &amp; Soya.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>STORAGE INFORMATION</strong><br />\nStore at below 4&deg;C.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Weight</strong><br />\n1000g</p>\n', b'1', 0),
(40, 'Sesame Buns', 4, 0, 'thumb-EazUT.png', '[]', '<p>Our signature Belgium Chocolate Truffle Cake is every chocolate connoisseur&rsquo;s delight. Wonderfully textured, the soft chocolate sponge is layered with dark chocolate creamy ganache, making this dessert cake the perfect end to any meal, or a standalone indulgence. Elegant and dense with the sinful richness of chocolate cream, the moist eggless signature chocolate cake takes center stage on any occasion. The celebratory cake pairs equally well with a glass of red wine as well as hot chocolate, or even a light herbal tea.</p>\n\n<p><br />\nFrom anniversary parties with family and friends or any such special occasion to a quiet evening with a loved one, this Belgium Chocolate Truffle cake is a perfect choice. Buy it from our signature cake shop!<br />\n&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Chocolate cake</strong><strong>&nbsp;is the comfort food we all deserve</strong></p>\n\n<p>Do you know why chocolate scores high as comfort food? Scientists say that comfort foods are associated with caregivers of our childhood. Your mind may associate loving memories of your mother making a chocolate cake on special days, or her buying you your favourite chocolate to celebrate good times. As adults, our minds still seek out the feeling of comfort from the sweet treat of childhood, chocolate.</p>\n\n<p>&nbsp;</p>\n\n<p><em>Feeling low? Call for our Belgium Chocolate Truffle Cake.</em></p>\n\n<p>&nbsp;</p>\n\n<p><strong>INGREDIENTS</strong></p>\n\n<p>Cake Premix (Refined Wheat Flour, Sugar, Milk Solids, Edible Vegetable Oil, Dextrose, Modified Starches, Baking Powder, Raising Agent, Emulsifiers &amp; Stabilizers and Salt), Milk Solids, Sugar, Dark Chocolate [Cocoa Solids, Sugar, Cocoa Butter, Emulsifier], Liquid Glucose.</p>\n\n<p><strong>ALLERGEN ADVICE</strong></p>\n\n<p>Contains Milk Solids, Gluten &amp; Soya.</p>\n\n<p><strong>STORAGE INFORMATION</strong></p>\n\n<p>Store at below 4&deg;C.</p>\n\n<p><strong>Weight</strong><br />\n1000g</p>\n', b'1', 0),
(41, 'Corn Ciabatta', 6, 0, 'thumb-R4BWe.jpg', '[]', '<p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur.</p>\n\n<ul>\n	<li>Cotton blend</li>\n	<li>Straight fit</li>\n	<li>Dry clean</li>\n</ul>\n\n<p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. sunt explicabo. Nemo enim ipsam</p>\n', b'1', 0),
(42, 'French Bagel', 4, 0, 'thumb-Jh1WR.png', '[]', '<p>Our signature Belgium Chocolate Truffle Cake is every chocolate connoisseur&rsquo;s delight. Wonderfully textured, the soft chocolate sponge is layered with dark chocolate creamy ganache, making this dessert cake the perfect end to any meal, or a standalone indulgence. Elegant and dense with the sinful richness of chocolate cream, the moist eggless signature chocolate cake takes center stage on any occasion. The celebratory cake pairs equally well with a glass of red wine as well as hot chocolate, or even a light herbal tea.</p>\n\n<p><br />\nFrom anniversary parties with family and friends or any such special occasion to a quiet evening with a loved one, this Belgium Chocolate Truffle cake is a perfect choice. Buy it from our signature cake shop!<br />\n&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Chocolate cake</strong><strong>&nbsp;is the comfort food we all deserve</strong></p>\n\n<p>Do you know why chocolate scores high as comfort food? Scientists say that comfort foods are associated with caregivers of our childhood. Your mind may associate loving memories of your mother making a chocolate cake on special days, or her buying you your favourite chocolate to celebrate good times. As adults, our minds still seek out the feeling of comfort from the sweet treat of childhood, chocolate.</p>\n\n<p>&nbsp;</p>\n\n<p><em>Feeling low? Call for our Belgium Chocolate Truffle Cake.</em></p>\n\n<p>&nbsp;</p>\n\n<p><strong>INGREDIENTS</strong></p>\n\n<p>Cake Premix (Refined Wheat Flour, Sugar, Milk Solids, Edible Vegetable Oil, Dextrose, Modified Starches, Baking Powder, Raising Agent, Emulsifiers &amp; Stabilizers and Salt), Milk Solids, Sugar, Dark Chocolate [Cocoa Solids, Sugar, Cocoa Butter, Emulsifier], Liquid Glucose.</p>\n\n<p><strong>ALLERGEN ADVICE</strong></p>\n\n<p>Contains Milk Solids, Gluten &amp; Soya.</p>\n\n<p><strong>STORAGE INFORMATION</strong></p>\n\n<p>Store at below 4&deg;C.</p>\n\n<p><strong>Weight</strong><br />\n1000g</p>\n', b'1', 0),
(43, 'Square Bun', 4, 0, 'thumb-cwnvI.png', '[]', '<p>Our signature Belgium Chocolate Truffle Cake is every chocolate connoisseur&rsquo;s delight. Wonderfully textured, the soft chocolate sponge is layered with dark chocolate creamy ganache, making this dessert cake the perfect end to any meal, or a standalone indulgence. Elegant and dense with the sinful richness of chocolate cream, the moist eggless signature chocolate cake takes center stage on any occasion. The celebratory cake pairs equally well with a glass of red wine as well as hot chocolate, or even a light herbal tea.</p>\n\n<p><br />\nFrom anniversary parties with family and friends or any such special occasion to a quiet evening with a loved one, this Belgium Chocolate Truffle cake is a perfect choice. Buy it from our signature cake shop!<br />\n&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Chocolate cake</strong><strong>&nbsp;is the comfort food we all deserve</strong></p>\n\n<p>Do you know why chocolate scores high as comfort food? Scientists say that comfort foods are associated with caregivers of our childhood. Your mind may associate loving memories of your mother making a chocolate cake on special days, or her buying you your favourite chocolate to celebrate good times. As adults, our minds still seek out the feeling of comfort from the sweet treat of childhood, chocolate.</p>\n\n<p>&nbsp;</p>\n\n<p><em>Feeling low? Call for our Belgium Chocolate Truffle Cake.</em></p>\n\n<p>&nbsp;</p>\n\n<p><strong>INGREDIENTS</strong></p>\n\n<p>Cake Premix (Refined Wheat Flour, Sugar, Milk Solids, Edible Vegetable Oil, Dextrose, Modified Starches, Baking Powder, Raising Agent, Emulsifiers &amp; Stabilizers and Salt), Milk Solids, Sugar, Dark Chocolate [Cocoa Solids, Sugar, Cocoa Butter, Emulsifier], Liquid Glucose.</p>\n\n<p><strong>ALLERGEN ADVICE</strong></p>\n\n<p>Contains Milk Solids, Gluten &amp; Soya.</p>\n\n<p><strong>STORAGE INFORMATION</strong></p>\n\n<p>Store at below 4&deg;C.</p>\n\n<p><strong>Weight</strong><br />\n1000g</p>\n', b'1', 0),
(44, 'Sesame Bread', 4.99, 0, 'thumb-Ipuzf.jpg', '[]', '<p>These Easy Sesame Bread Rolls need to be a staple on your Thanksgiving and Christmas dinner table. Soft and fluffy just the way they should be. Even if you&rsquo;re not the best baker (and I certainly am not), these rolls are so easy to make. Check out the step by step video.</p>\n\n<p>The two best smells that can come from your oven is baking bread and homemade cookies. Even better are when the rolls are fresh and warm out of the oven and eaten simply with a good, creamy butter.</p>\n\n<p>Now, I&rsquo;m no master baker, but even I can make these rolls without messing them up. There&rsquo;s no mixer needed. All you need is a bowl, a spatula, a warm place to proof the dough and a little time.</p>\n', b'1', 2),
(45, 'Sesame Buns', 4.99, 0, 'thumb-Ej2Mw.png', '[]', '<p>Make these sesame buns today, then question why it took you so long to make your own buns for burgers, egg sandwiches, fried chicken, and fillets o&rsquo; fish. This recipe from bread master&nbsp;<strong>Bryan Ford</strong>&nbsp;is based on his&nbsp;<a href=\"https://bonappetit.com/recipe/master-bread-dough\">Master Dough recipe</a>; simply portion it out, roll into tight balls, then dip in sesame seeds (or any small seeds and seasonings of your choice&mdash;poppy, flax, dried onion&hellip;). Ford bakes his buns in&nbsp;<a href=\"https://www.amazon.com/Norpro-Muffin-Rings-Set-4/dp/B0001VQIHW\" target=\"_blank\">muffin rings</a>, which gives them dramatic height&mdash;but free-form works just as well.</p>\n\n<p>All products featured on Bon App&eacute;tit are independently selected by our editors. However, when you buy something through the retail links below, we earn an affiliate commission.</p>\n', b'1', 0);

